window.bookSummaryJSON = "<p><b>N-number Five is Alive!</b></p> <p>Peace and a secure future are within the grasp of the Rangers and Osay colonists…if they can withstand the coming Reclamation Fleet.</p> <p>But first, they must deal with old enemies and the mysterious RUPAC research stations that will finally allow Reach, Brody, and company understand just where all of Amir’s various factions truly stand.</p> <p>Warm up the VCR, pop in a mixtape in your Walkman and get ready to jump back into the action-heavy rollicking fifth adventure in the international hit series Wayward Galaxy from <i>USA Today</i> bestselling authors J.N. Chaney and Jason Anspach, performed by award-winning narrator R.C. Bray.</p>"; 
